const axios = require('axios');

const getUsersById = (handleSuccess, email, password) => {
    axios.post(`http://localhost:8000/login`, {email, password})
    .then(success => {
        handleSuccess(success.data)
    }).catch(error => console.log(error))
}

export {getUsersById};
